 function PopulateHouseList()
 {
    let hs = document.getElementById("houses-select");
    for(let h of HouseList)
    {
        let option = document.createElement("option");
        option.text = h[0];
        hs.add(option);
    }
}
   
function PopulateRoomList()
{
   let rs = document.getElementById("rooms-select");
   for(let i = rs.options.length - 1; i >= 0; i--)
   {
       rs.remove(i);
   }
   for(let i = 1; i <= thisHouse.numberORooms; i++)
   {
       let option = document.createElement("option");
       option.text = thisHouse.theRooms[i].roomName;
       rs.add(option);
   }
}
